window.bookSummaryJSON = "<p>Thorn is back! The guilty will be punished. </p> <p>The war they dismissed as nonsense is now raging. </p> <p>Jen needs Thorn. The military want Thorn. </p> <p>Thorn is older and wiser, and he doesn't care what anyone wants. </p> <p>He has a better hold on his growing power, or so he thinks. </p> <p>The war calls, but there is unfinished business to attend to on the way. </p> <p>Unanswered questions lead in strange directions, and a war for no reason, is only part of the mystery. </p> <p>But through everything, Thorn carries two themes. The guilty will be punished, and there will be peace! </p> <p>Yesterday was just the start. Now he's Today's Spacemage.</p>"; 
